import React, { Component } from 'react';
import  Header from '../header/header';
import Headerone from './headerone/headerone';
import Headertwo from './headertwo/headertwo';
import Headerthree from './headerthree/headerthree';
import Headerfour from './headerfour/headerfour';

import Logo from '../../images/mindbox.svg';
class headercomponent extends Component {
    constructor(props)
    {
        super(props)
        this.state = {
            header: [
            {title: 'Headers'}
            ],
         }
     }

    render() {
        const data = [{
            "id": 1,
          "name": "About",

        }, {
            "id": 2,
          "name": "Features",

        }, {
            "id": 3,
          "name": "Learn & Support",

        }, {
            "id": 4,
          "name": "Compare Plans",

        }];
        var divStyle = {
            background: "#f2f2f2",
            padding: "32px 0",
            float: "left",
            width: "100%",
          };
          var divStyle2 = {
            background: "#f2f2f2",
            padding: "32px 0",
            paddingTop: "0",
            float: "left",
            width: "100%",
          };
        return (
             <div className="wrapper">
                 <section className="container">
                     <div className="row">
                         <Header header={this.state.header[0].title} />
                     </div>


                 </section>
                 <div style={divStyle}>
                     <Headerone Headerlogo={Logo}  data={ data }  />
                 </div>
                 <div style={divStyle2}>
                     <Headertwo Headerlogo={Logo}  data={ data } />
                 </div>
                 <div style={divStyle2}>
                     <Headerthree  
                     Headerlogo={Logo}
                     login={[{label: 'Subscribe', url: '#' },{label: 'Sign Up', url: '#' },{label: 'Log In', url: '#' }]}
                     language={['EN','Us']}
                     currancy={['USD','EUR']}
                     number="Customer Service 24/7  | 7874205553"
                     delivery="FREE NEXT DAY DELIVERY OVER $150"
                     />
                 </div>
                 <div style={divStyle2}>
                   <Headerfour 
                     Headerlogo={Logo}
                     location="United States"
                     menu={[{label: 'Corporate', url: '#' },{label: 'Store', url: '#' },{label: 'Stream TV', url: '#' },{label: 'Finance', url: '#' },{label: 'More', url: '#' }]}
                     menu2={[{label: 'Plans', url: '#' },{label: 'Features', url: '#' },{label: 'Whats New', url: '#' },{label: 'Help Center', url: '#' }]}
                     />
                 </div>
             </div>
        );
    }
}

export default headercomponent;
